'use client'

import React, { useState } from 'react'
import { useNavigate } from 'react-router-dom'
// Remove Next.js and shadcn/ui imports
// Add any necessary CSS imports

export default function LoginPage() {
  const [userType, setUserType] = useState('employee')
  const [userId, setUserId] = useState('')
  const [password, setPassword] = useState('')
  const [isCreatingPassword, setIsCreatingPassword] = useState(false)
  const [error, setError] = useState('')
  const navigate = useNavigate()

  const handleLogin = async (e) => {
    e.preventDefault()
    setError('')
    console.log('Attempting login with:', { userType, userId, password })
    if (userType === 'employee') {
      try {
        // Simulating API call
        const response = await new Promise((resolve) => 
          setTimeout(() => resolve({ requiresPasswordCreation: false }), 1000)
        )
        if (response.requiresPasswordCreation) {
          setIsCreatingPassword(true)
        } else {
          localStorage.setItem('isAuthenticated', 'true')
          localStorage.setItem('userType', 'employee')
          localStorage.setItem('userId', userId)
          navigate('/employee-home')
        }
      } catch (error) {
        console.error('Login error:', error)
        setError('An error occurred during login. Please try again.')
      }
    } else if (userType === 'admin' && userId === 'admin1' && password === 'admin123') {
      localStorage.setItem('isAuthenticated', 'true')
      localStorage.setItem('userType', 'admin')
      navigate('/home')
    } else {
      setError('Invalid credentials')
    }
  }

  const handleCreatePassword = async (e) => {
    e.preventDefault()
    setError('')
    try {
      // Simulating API call
      await new Promise((resolve) => setTimeout(resolve, 1000))
      alert('Password created successfully. Please log in.')
      setIsCreatingPassword(false)
    } catch (error) {
      setError('An error occurred while creating the password. Please try again.')
    }
  }

  return (
    <div className="login-container">
      <div className="login-left">
        <h1>KAPSRI</h1>
        <h2>TECHNOLOGIES</h2>
        <p>Your one-stop solution for all your Fire and safety Needs.</p>
        <div className="client-logos">
          {/* Replace Image components with img tags */}
          <img src="/placeholder.svg" alt="HDFC Bank" className="client-logo" />
          <img src="/placeholder.svg" alt="Zomato" className="client-logo" />
          <img src="/placeholder.svg" alt="Swiggy" className="client-logo" />
          <img src="/placeholder.svg" alt="Fireside" className="client-logo" />
          <span>+25 more</span>
        </div>
      </div>
      <div className="login-right">
        <div className="login-card">
          <img src="/placeholder.svg" alt="Logo" className="logo" />
          <form onSubmit={isCreatingPassword ? handleCreatePassword : handleLogin}>
            {!isCreatingPassword && (
              <select value={userType} onChange={(e) => setUserType(e.target.value)}>
                <option value="employee">Employee</option>
                <option value="admin">Admin</option>
              </select>
            )}
            <input
              type="text"
              value={userId}
              onChange={(e) => setUserId(e.target.value)}
              placeholder={userType === 'employee' ? 'User ID' : 'Username'}
              required
            />
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              placeholder="Password"
              required
            />
            <button type="submit">
              {isCreatingPassword ? 'Create Password' : 'Login'}
            </button>
          </form>
          {error && <p className="error-message">{error}</p>}
          <button className="forgot-password">Forgot Password?</button>
        </div>
      </div>
    </div>
  )
}
